import React, { ComponentPropsWithoutRef } from 'react';

type ImgProps = ComponentPropsWithoutRef<'img'>;

type Props = {
  src:string
} & ImgProps

const Img: React.FC<Props> = () => {
  return <img {...props} src={src} />;
};

export default Img;
